function R = solver_pnp_quat(M)

    sols = solver_opt_pnp_nakanoQ_sym(M);
    sols = sols(:, any(not(imag(sols))));
    R = zeros(3,3,size(sols,2));
    for i = 1:size(sols,2)
        q = sols(:,i);
        R(:,:,i) = quat2rot( q/norm(q) );
    end

end

